import React from 'react';
import {navigation} from "../app_data/header_array";
import Main_nav_item from "./main_nav_item.jsx";
import "./header.css";

class Header extends React.Component{
    render() {
        return(
            <header className={"text-align-center"} id={"top-bar" }>
                <div className={"container-fluid "} id={"first_row"}>
                    <div id={"first_row_left"}>
                        <img className={"logo_img"} src={"./images/realtor.png"} alt={""}/>
                        <Main_nav_item/>
                    </div>
                </div>
            </header>
        )
    }
}

export default Header;
